<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta name="ad.size" content="width=100%,height=100%">
    <style>
        * {
            -webkit-touch-callout: none;
            /* prevent callout to copy image, etc when tap to hold */
            -webkit-text-size-adjust: none;
            /* prevent webkit from resizing text to fit */
            /* make transparent link selection, adjust last value opacity 0 to 1.0 */
            -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
            -webkit-user-select: none;
            /* prevent copy paste, to allow, change 'none' to 'text' */
            /* -webkit-tap-highlight-color: rgba(0,0,0,0); */
        }

        body,
        html {
            overflow: hidden;
            margin: 0;
            display: flex;
            width: 100%;
            height: 100%;
            justify-content: center;
            align-items: center;
        }

        .container {
            position: relative;
            top: 0;
            left: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            overflow: hidden;
            /*outline: 1px solid;*/
        }

        .container::before {
            content: '';
            position: absolute;
            background: #fff;
            width: 100%;
            height: 8%;
            bottom: 0;
            left: 50%;
            transform: translateX(-50%);
        }

        .container2 {
            position: relative;
            top: 0;
            left: 0;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        .container2::before {
            content: '';
            position: absolute;
            background: #ffd200;
            width: 400%;
            height: 400%;
            top: -110%;
            left: 11%;
            transform: rotate(26deg);
            transition: 1000ms;
        }

        .bg {
            max-height: 100vh;
            max-width: 100vw;
            opacity: 0;
        }

        .container img:not(.bg) {
            position: absolute;
            max-width: 100%;
            max-height: 100%;
        }

        .tap {
            top: 5%;
            left: 0;
            width: 80%;
        }

        #robot {
            max-width: 100%;
            position: absolute;
            top: 50%;
            left: 50%;
            z-index: 1;
            transform: translate(-50%, -50%);
            width: 60%;
        }

        #redux {
            position: absolute;
            top: 16.8%;
            left: 19.9%;
            z-index: 2;
            /*border-radius: 100px;*/
        }

        .notification {
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            z-index: 1;
            /*width: 38%;*/
            width: 0;
            transition: 700ms;
        }

        .notification:active {
            transition: 100ms;
            width: 36% !important;
        }

        .finalFrame {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            opacity: 0;
            z-index: -1;
        }

        .save {
            top: 10%;
            left: 0;
            width: 80%;
            transform: translateX(-200%);
            transition: 1000ms;
        }

        .coffee {
            top: 61%;
            left: 50%;
            width: 35%;
            transform: translateX(-250%);
            transition: 700ms;
        }

        .download {
            top: 46%;
            left: 8%;
            /*width: 42%;*/
            width: 0;
            transition: 700ms;
        }

        .legal {
            left: 50%;
            bottom: 1%;
            width: 93%;
            transform: translateX(-50%);
        }

        /**/
        /* hidding phone and a tap text*/
        /**/

        .container2.hide .tap {
            transition: 400ms;
            transform: translateX(-200%);
        }

        .container2.hide #robot,
        .container2.hide #redux {
            transition: 700ms;
            transform: translate(-250%, -50%);
        }

        .container2.hide::before {
            top: -60%;
        }

        .container2.hide .finalFrame {
            z-index: 1;
            opacity: 1;
        }

        .container2.hide .save,
        .container2.hide .app {
            transform: translate(0);
        }

        .container2.hide .download {
            width: 42%;
        }

        .container2.hide .coffee {
            transform: translateX(-50%);
        }
    </style>
    <title>Document</title>
</head>

                        // listen for resize event to update offset values
                        $(window).resize(function () {
                            var pos = $canvas.offset();
                            data.posX = pos.left;
                            data.posY = pos.top;
                        });
                    }
                });
            },
            touchStart: function (event) {
                var $this = $(this),
                    data = $this.data('eraser');

                if (!data.touchDown) {
                    var t = event.originalEvent.changedTouches[0],
                        tx = t.pageX - data.posX,
                        ty = t.pageY - data.posY;
                    methods.evaluatePoint(data, tx, ty);
                    data.touchDown = true;
                    data.touchID = t.identifier;
                    data.touchX = tx;
                    data.touchY = ty;
                    event.preventDefault();
                }
            },
            touchMove: function (event) {
                movingTime++;
                console.log(movingTime);

                if (movingTime > 250) {
                    $('#redux').eraser('clear');
                    setTimeout(function () {
                        document.querySelector('.container2').classList.add('hide');
                    }, 700);
                }

                var $this = $(this),
                    data = $this.data('eraser');

                if (data.touchDown) {
                    var ta = event.originalEvent.changedTouches,
                        n = ta.length;
                    while (n--)
                        if (ta[n].identifier == data.touchID) {
                            var tx = ta[n].pageX - data.posX,
                                ty = ta[n].pageY - data.posY;
                            methods.evaluatePoint(data, tx, ty);
                            data.ctx.beginPath();
                            data.ctx.moveTo(data.touchX, data.touchY);
                            data.touchX = tx;
                            data.touchY = ty;
                            data.ctx.lineTo(data.touchX, data.touchY);
                            data.ctx.stroke();
                            event.preventDefault();
                            break;
                        }
                }
            },
            touchEnd: function (event) {
                var $this = $(this),
                    data = $this.data('eraser');

                if (data.touchDown) {
                    var ta = event.originalEvent.changedTouches,
                        n = ta.length;
                    while (n--)
                        if (ta[n].identifier == data.touchID) {
                            data.touchDown = false;
                            event.preventDefault();
                            break;
                        }
                }
            },

            evaluatePoint: function (data, tx, ty) {
                var p = Math.floor(tx / data.size) + Math.floor(ty / data.size) * data.colParts;
                if (p >= 0 && p < data.numParts) {
                    data.ratio += data.parts[p];
                    data.parts[p] = 0;
                    if (!data.complete) {
                        if (data.ratio / data.numParts >= data.completeRatio) {
                            data.complete = true;
                            if (data.completeFunction != null) data.completeFunction();
                        }
                    }
                }

            },

            mouseDown: function (event) {
                var $this = $(this),
                    data = $this.data('eraser'),
                    tx = event.pageX - data.posX,
                    ty = event.pageY - data.posY;
                methods.evaluatePoint(data, tx, ty);
                data.touchDown = true;
                data.touchX = tx;
                data.touchY = ty;
                data.ctx.beginPath();
                data.ctx.moveTo(data.touchX - 1, data.touchY);
                data.ctx.lineTo(data.touchX, data.touchY);
                data.ctx.stroke();
                $this.bind('mousemove.eraser', methods.mouseMove);
                $(document).bind('mouseup.eraser', data, methods.mouseUp);
                event.preventDefault();
            },

            mouseMove: function (event) {
                movingTime++;
                console.log(movingTime);

                if (movingTime > 250) {
                    $('#redux').eraser('clear');
                    setTimeout(function () {
                        document.querySelector('.container2').classList.add('hide');
                    }, 700);
                }

                var $this = $(this),
                    data = $this.data('eraser'),
                    tx = event.pageX - data.posX,
                    ty = event.pageY - data.posY;
                methods.evaluatePoint(data, tx, ty);
                data.ctx.beginPath();
                data.ctx.moveTo(data.touchX, data.touchY);
                data.touchX = tx;
                data.touchY = ty;
                data.ctx.lineTo(data.touchX, data.touchY);
                data.ctx.stroke();
                event.preventDefault();
            },

            mouseUp: function (event) {
                var data = event.data,
                    $this = data.canvas;
                data.touchDown = false;
                $this.unbind('mousemove.eraser');
                $(document).unbind('mouseup.eraser');
                event.preventDefault();
            },

            clear: function () {
                var $this = $(this),
                    data = $this.data('eraser');
                if (data) {
                    data.ctx.clearRect(0, 0, data.w, data.h);
                    var n = data.numParts;
                    while (n--) data.parts[n] = 0;
                    data.ratio = data.numParts;
                    data.complete = true;
                    if (data.completeFunction != null) data.completeFunction();
                }
            },

            size: function (value) {
                var $this = $(this),
                    data = $this.data('eraser');
                if (data && value) {
                    data.size = value;
                    data.ctx.lineWidth = value;
                }
            },

            reset: function () {
                var $this = $(this),
                    data = $this.data('eraser');
                if (data) {
                    data.ctx.globalCompositeOperation = "source-over";
                    data.ctx.drawImage(data.source, 0, 0);
                    data.ctx.globalCompositeOperation = "destination-out";
                    var n = data.numParts;
                    while (n--) data.parts[n] = 1;
                    data.ratio = 0;
                    data.complete = false;
                }
            }

        };

        $.fn.eraser = function (method) {
            if (methods[method]) {
                return methods[method].apply(this, Array.prototype.slice.call(arguments, 1));
            } else if (typeof method === 'object' || !method) {
                return methods.init.apply(this, arguments);
            } else {
                $.error('Method ' + method + ' does not yet exist on jQuery.eraser');
            }
        };
    })(jQuery);

    addEventListener("load", init, false);

    function init(event) {
        $("#redux").eraser({size: convertX(20)});

        // you can alse specify the brush size (in pixel) by using options :
        // $("#redux").eraser({size: 20});
    }

    function remove(event) {
        $("#redux").eraser('clear');
        event.preventDefault();
    }

    function reset(event) {
        $("#redux").eraser('reset');
        event.preventDefault();
    }

    document.querySelector('.download').addEventListener('click', function () {
        FbPlayableAd.onCTAClick();
    });
</script>
